INSERT INTO `game` VALUES (1,'Spirit Fear','The secret ingredient to his wonderful life was crime.','2004-10-27 00:00:00',5,2,'2022-11-20 08:20:15'),(2,'Hallowed Abyss','He realized there had been several deaths on this road, but his concern rose when he saw the exact number.','2007-05-08 00:00:00',15,8,'2022-11-20 08:20:15'),(3,'Charge of Trickery','Everyone pretends to like wheat until you mention barley.','2008-08-22 00:00:00',23,5,'2022-11-20 08:20:15'),(4,'Run of Trickery','Thirty years later, she still thought it was okay to put the toilet paper roll under rather than over.','2008-12-07 00:00:00',24,6,'2022-11-20 08:20:15'),(5,'Whispers and Power','The balloons floated away along with all my hopes and dreams.','2009-11-19 00:00:00',27,4,'2022-11-20 08:20:15'),(6,'Barbarians and Freedom','They\'re playing the piano while flying in the plane.','2011-03-31 00:00:00',29,3,'2022-11-20 08:20:15'),(7,'Datacraze','I was very proud of my nickname throughout high school but today- I couldn’t be any different to what my nickname was.','2011-10-31 00:00:00',14,8,'2022-11-20 08:20:15'),(8,'Fuseland','When confronted with a rotary dial phone the teenager was perplexed.','2012-04-01 00:00:00',4,2,'2022-11-20 08:20:15'),(9,'Bulletzone','We should play with legos at camp.','2012-05-24 00:00:00',15,2,'2022-11-20 08:20:15'),(10,'Bulletfire','The water flowing down the river didn’t look that powerful from the car','2015-04-19 00:00:00',3,6,'2022-11-20 08:20:15'),(11,'Primal Syndrome','The shooter says goodbye to his love.','2015-08-12 00:00:00',24,1,'2022-11-20 08:20:15'),(12,'Armageddon Resurrection','Art doesn\'t have to be intentional.','2015-09-16 00:00:00',1,6,'2022-11-20 08:20:15'),(13,'Command of Liberty','Check back tomorrow; I will see if the book has arrived.','2016-10-18 00:00:00',26,1,'2022-11-20 08:20:15'),(14,'Pillage of Redemption','The rusty nail stood erect, angled at a 45-degree angle, just waiting for the perfect barefoot to come along.','2016-12-12 00:00:00',8,4,'2022-11-20 08:20:15'),(15,'Day and Paradise','It caught him off guard that space smelled of seared steak.','2017-01-15 00:00:00',5,3,'2022-11-20 08:20:15'),(16,'Conflict and Hope','Lightning Paradise was the local hangout joint where the group usually ended up spending the night.','2017-06-18 00:00:00',8,5,'2022-11-20 08:20:15'),(17,'Farrain','My secretary is the only person who truly understands my stamp-collecting obsession.','2017-07-01 00:00:00',15,7,'2022-11-20 08:20:15'),(18,'Astroshot','There are few things better in life than a slice of pie.','2017-10-18 00:00:00',20,5,'2022-11-20 08:20:15'),(19,'Bulletnite','Eating eggs on Thursday for choir practice was recommended.','2017-11-03 00:00:00',29,1,'2022-11-20 08:20:15'),(20,'Airdude','My uncle\'s favorite pastime was building cars out of noodles.','2017-12-04 00:00:00',27,8,'2022-11-20 08:20:15'),(21,'Crossphobia','He played the game as if his life depended on it and the truth was that it did.','2018-06-09 00:00:00',18,1,'2022-11-20 08:20:15'),(22,'Chromaphobia','The shark-infested South Pine channel was the only way in or out.','2019-03-24 00:00:00',3,4,'2022-11-20 08:20:15'),(23,'Protect of Invasion','I’m working on a sweet potato farm.','2020-09-09 00:00:00',10,4,'2022-11-20 08:20:15');
