INSERT INTO `producer` VALUES (1,'The NineHertz.','Tom got a small piece of pie.',6,0.06,'2022-11-20 08:20:15'),(2,'iTechArt.','If eating three-egg omelets causes weight-gain, budgie eggs are a good substitute.',7,0.14,'2022-11-20 08:20:15'),(3,'Juego Studios.','She had convinced her kids that any mushroom found on the ground would kill them if they touched it.',10,0.99,'2022-11-20 08:20:15'),(4,'Zero Games Studio.','Jenny made the announcement that her baby was an alien.',1,0.74,'2022-11-20 08:20:15'),(5,'Electronic Arts.','He watched the dancing piglets with panda bear tummies in the swimming pool.',12,0.13,'2022-11-20 08:20:15'),(6,'Nintendo.','It was at that moment that he learned there are certain parts of the body that you should never Nair.',7,0.7,'2022-11-20 08:20:15'),(7,'Ubisoft.','The snow-covered path was no help in finding his way out of the back-country.',1,0.84,'2022-11-20 08:20:15'),(8,'Sony Interactive Entertainment.','The door swung open to reveal pink giraffes and red elephants.',9,0.92,'2022-11-20 08:20:15'),(9,'Tencent','It didn\'t make sense unless you had the power to eat colors.',11,0.89,'2022-11-20 08:20:15'),(10,'Sony','Today we gathered moss for my uncle\'s wedding.',2,0.96,'2022-11-20 08:20:15'),(11,'Apple','I want to buy a onesie… but know it won’t suit me.',9,0.73,'2022-11-20 08:20:15'),(12,'Microsoft','He was all business when he wore his clown suit.',10,0.4,'2022-11-20 08:20:15'),(13,'NetEase','He would only survive if he kept the fire going and he could hear thunder in the distance.',6,0.03,'2022-11-20 08:20:15'),(14,'Google','It was the first time he had ever seen someone cook dinner on an elephant.',9,0.34,'2022-11-20 08:20:15'),(15,'Electronic Arts','The sun had set and so had his dreams.',6,0.48,'2022-11-20 08:20:15'),(16,'Nintendo','He liked to play with words in the bathtub.',3,0.25,'2022-11-20 08:20:15'),(17,'Activision Blizzard','The hand sanitizer was actually clear glue.',6,0.37,'2022-11-20 08:20:15'),(18,'Sea Group','Sometimes it is better to just walk away from things and go back to them later when you’re in a better frame of mind.',9,0.72,'2022-11-20 08:20:15'),(19,'Bandai Namco Entertainment','If you really strain your ears, you can just about hear the sound of no one giving a damn.',3,0.24,'2022-11-20 08:20:15'),(20,'Take-Two Interactive','Nancy was proud that she ran a tight shipwreck.',11,0.33,'2022-11-20 08:20:15'),(21,'Nexon','The anaconda was the greatest criminal mastermind in this part of the neighborhood.',7,0.46,'2022-11-20 08:20:15'),(22,'Playtika','The white water rafting trip was suddenly halted by the unexpected brick wall.',2,0.1,'2022-11-20 08:20:15'),(23,'37 Interactive','I was very proud of my nickname throughout high school but today- I couldn’t be any different to what my nickname was.',8,0.31,'2022-11-20 08:20:15'),(24,'NCSoft','Waffles are always better without fire ants and fleas.',11,0.19,'2022-11-20 08:20:15'),(25,'Roblox','Most shark attacks occur about 10 feet from the beach since that\'s where the people are.',10,0.75,'2022-11-20 08:20:15'),(26,'Ubisoft','The murder hornet was disappointed by the preconceived ideas people had of him.',7,0.25,'2022-11-20 08:20:15'),(27,'Netmarble','He learned the hardest lesson of his life and had the scars, both physical and mental, to prove it.',4,0.62,'2022-11-20 08:20:15'),(28,'Square Enix','They wandered into a strange Tiki bar on the edge of the small beach town.',2,0.97,'2022-11-20 08:20:15'),(29,'CyberAgent','The busker hoped that the people passing by would throw money, but they threw tomatoes instead, so he exchanged his hat for a juicer.',9,0.73,'2022-11-20 08:20:15'),(30,'Konami','When confronted with a rotary dial phone the teenager was perplexed.',9,0.81,'2022-11-20 08:20:15');
